package com.cache;

public class Account {
	
	private int id;
	private String name;
	
	public Account(String name) {
		// TODO Auto-generated constructor stub
		this.name = name;
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	
}
